import React from "react";
import Form from "./Form";
import List from "./List";
import Footer from "./Footer";

const TodoList = ({todos,
                      setTodos,
                      filter,
                  }) => {
    return (
        <div>
            <Form/>
            <List
                filter={filter}
                setTodo={setTodos}
                todos={todos}
            />
            <Footer todos={todos}/>
        </div>
    );
};

export default TodoList;
